import profile from '../Images/pfp.png';
import Tweet from './Tweet.js';
import '../Styles/Body.css'

const Body = () => {
    return(
        <div>
            <div id = "header">
            <img style={{ width: 500, height: 500 }} src={profile}></img>
            <Tweet profile = {"@Tanush"} text={"Gohoos"}/>
            <Tweet profile = {"@Bryon"} text={"Gosource"}/>
            </div>
        </div>

    );
}

export default Body;
